import React from 'react';
import { View, Image, Text, StyleSheet } from 'react-native';

const MyComponent = () => {
  return (
    <View style={styles.container}>
      <View style={styles.imageContainer}>
        <Image
          source={require('./images/logo.png')}
          style={styles.image}
        />
      </View>
      <View style={styles.textContainer}>
        <Text style={styles.text}>גיהוץ למשפחות</Text>
        <Text style={styles.text}>הסעת חולים</Text>
        <Text style={styles.text}>העברת חבילות</Text>
        <Text style={styles.text}>קניות למשפחה</Text>
        <Text style={styles.text}>שמירה על ילדים בבתי חולים</Text>
      </View>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
  },
  imageContainer: {
    marginBottom: 20,
  },
  image: {
    width: 200,
    height: 200,
    resizeMode: 'contain',
  },
  textContainer: {
    alignItems: 'center',
  },
  text: {
    fontSize: 18,
    marginBottom: 10,
  },
});

export default MyComponent;
